class MyDenseChebConv(nn.Module):
    def __init__(self,
                 in_feats,
                 out_feats,
                 k,
                 bias=True):
        super(MyDenseChebConv, self).__init__()
        self._in_feats = in_feats
        self._out_feats = out_feats
        self._k = k
        self.W = nn.Parameter(torch.Tensor(k, in_feats, out_feats))
        if bias:
            self.bias = nn.Parameter(torch.Tensor(out_feats))
        else:
            self.register_buffer('bias', None)
        self.reset_parameters()

    def reset_parameters(self):
        """Reinitialize learnable parameters."""
        if self.bias is not None:
            init.zeros_(self.bias)
        for i in range(self._k):
            init.xavier_normal_(self.W[i], init.calculate_gain('relu'))

    def forward(self, adj, feat, lambda_max=None):
       
        A = adj.to(feat)
        num_nodes = A.shape[0]

        in_degree = 1 / A.sum(dim=1).clamp(min=1).sqrt()
        D_invsqrt = torch.diag(in_degree)
        I = torch.eye(num_nodes).to(A)
        L = I - D_invsqrt @ A @ D_invsqrt

        L_hat = 2 * L / 2.0 - I
        Z = [torch.eye(num_nodes).to(A)]
        for i in range(1, self._k):
            if i == 1:
                Z.append(L_hat)
            else:
                Z.append(2 * L_hat @ Z[-1] - Z[-2])

        Zs = torch.stack(Z, 0)  # (k, n, n)

       # Zh = (Zs @ feat.unsqueeze(1) @ self.W)
      
        Zh=torch.matmul(Zs,feat.unsqueeze(1))
        Zh=torch.matmul(Zh,self.W)
        Zh = Zh.sum(1)

        if self.bias is not None:
            Zh = Zh + self.bias
        return Zh



class SRMLayer(nn.Module):
        def __init__(self):
            super().__init__() 

            self.cfc=nn.Parameter(torch.Tensor(2,1))
            self.bn=nn.BatchNorm1d(5)

        def forward(self,x):
                b,c,h,w=x.size()
                mean=x.view(b,c,-1).mean(-1).unsqueeze(-1)
                std=x.view(b,c,-1).std(-1).unsqueeze(-1)
                u=torch.cat((mean,std),-1)  # (b,c,2)

                z=torch.matmul(u,self.cfc)
                z=self.bn(z)
                g=torch.sigmoid(z)
                g=g.view(b,c,1,1)

                return x*g.expand_as(x)
        
class SENet(nn.Module):
    def __init__(self, in_planes=5):
        super(SENet, self).__init__()
        self.avg_pool = nn.AdaptiveAvgPool2d(1)  # 通道数不变，H*W变为1*1
        self.fc1 = nn.Conv2d(in_planes, in_planes // 5, 1, bias=False)
        self.relu1 = nn.ReLU()
        self.fc2 = nn.Conv2d(in_planes // 5, in_planes, 1, bias=False)
        self.sigmoid = nn.Sigmoid()
    def forward(self, x):
        x = self.avg_pool(x)
        x= self.fc1(x)
        x=self.relu1(x)
        avg_out = self.fc2(x)
        return x*self.sigmoid(avg_out)

