    def forward(self, x,adj, batch0,t=0):
        channl = self.channl
        m=adj.size(0)
        x=x.reshape(m,5,62)
        adj=adj.reshape(m,5,62,62)
        x=x.permute(0,2,1)
        #adj=adj.permute(0,2,3,1)
        adj=adj[:,channl].reshape(m,62,62)
        x=x[:,self.indexx,:].reshape(m,30,5)
        #adj=adj[:,self.indexx,:,:][:,:,self.indexx,:].reshape(m,30,30,5)
        adj=adj[:,self.indexx,:][:,:,self.indexx].reshape(m,30,30)
        phadj = self.phadj[self.indexx,:][:,self.indexx]
        jadj=torch.triu(phadj,diagonal=1)
        jadj=jadj+jadj.T+ torch.eye(30).to(jadj)
        x=self.gcn1(jadj,x) #
        x1=torch.matmul(x,self.conv1)+self.bias1  #100,30,30
        x2=adj
        x1=torch.matmul(self.atten0,x1)+self.bias2
        tamp = torch.matmul(self.atten0,x2)
        x2=tamp+self.bias3
        x3=torch.cat((x1,x2),1) #100,30  100,30,5
        x3=x3.reshape(m,5,3,4)
        x3 = x3*self.senet(x3)
        #x3=self.srm(x3)
        x4=x.reshape(m,30*10)
        x3=x3.reshape(m,60)
        xx=torch.cat((x4,x3),1)
        xx =self.mlp(xx)
        pred = F.softmax(xx,1)
        return  xx, pred